import React, { useState } from "react";
import { Form, Toast, Button } from "react-bootstrap";
import LockIcon from "@material-ui/icons/Lock";
import MailOutlineIcon from '@material-ui/icons/MailOutline';
import { useParams, useHistory } from "react-router-dom";
import axios from "axios";
import "../styles.css";

const ResetPassword = () => {
  const { email } = useParams(); // البريد من الرابط
  const history = useHistory();
  const [formData, setFormData] = useState({ email, code: "", newPassword: "" });
  const [status, setStatus] = useState({ val: 0, msg: "", type: "" });

  const Alert = () => {
    return (
      <Toast 
        style={{
          position: "fixed",
          top: "20vh",
          left: "50%",
          transform: "translateX(-50%)",
          zIndex: "999999",
          minWidth: "300px",
          borderRadius: "10px"
        }}
        className={status.type === "darkGreen" ? "bg-success text-white" : "bg-danger text-white"}
      >
        <Toast.Body style={{ textAlign: "center", fontWeight: "bold" }}>
          {status.msg}
        </Toast.Body>
      </Toast>
    );
  };

  const handleChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });

  const handleSubmit = async (e) => {
    e.preventDefault();
    const { email, code, newPassword } = formData;
    if (!email || !code || !newPassword) return alert("Please fill all fields");
    try {
      const res = await axios.post(
        "http://localhost:5000/api/user/reset-password",
        { email, code, newPassword },
        { headers: { "Content-Type": "application/json" } }
      );
      setStatus({ val: 1, msg: res.data, type: "darkGreen" });

      // بعد 3 ثواني إعادة التوجيه لتسجيل الدخول
      setTimeout(() => history.push("/auth"), 3000);
    } catch (e) {
      setStatus({ val: 1, msg: e.response?.data || "Error", type: "red" });
      setTimeout(() => setStatus({ val: 0, msg: "", type: "" }), 3000);
    }
  };

  return (
    <>
      {status.val && <Alert />}
      <h4 style={{ marginTop: "6vh", fontFamily: "Mulish" }}>Reset Password</h4>
      <div className="forget">
        <p>
          <LockIcon style={{ fontSize: "1.2rem", color: "grey" }} />
          <span style={{ fontFamily: "Poppins", fontSize: "0.95rem" }}>
            Enter the code you received and your new password.
          </span>
        </p>

        <Form onSubmit={handleSubmit}>
          <Form.Group>
            <Form.Label>Email <MailOutlineIcon /></Form.Label>
            <Form.Control type="email" value={email} disabled style={{ borderRadius: "10px", padding: "1vh", fontSize: "0.95rem" }} />
          </Form.Group>

          <Form.Group>
            <Form.Label>Code</Form.Label>
            <Form.Control
              type="text"
              name="code"
              value={formData.code}
              onChange={handleChange}
              style={{ borderRadius: "10px", padding: "1vh", fontSize: "0.95rem" }}
              placeholder="Enter code"
            />
          </Form.Group>

          <Form.Group>
            <Form.Label>New Password</Form.Label>
            <Form.Control
              type="password"
              name="newPassword"
              value={formData.newPassword}
              onChange={handleChange}
              style={{ borderRadius: "10px", padding: "1vh", fontSize: "0.95rem" }}
              placeholder="New Password"
            />
          </Form.Group>

          <Button className="btn btn-primary" type="submit" style={{ borderRadius: "1vh", textTransform: "capitalize" }}>
            Submit
          </Button>
        </Form>
      </div>
    </>
  );
};

export default ResetPassword;
